import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Home from './Pages/Home';
import About from './Pages/About';

export default () => {
    return ( 
        <Switch>

            <Route exact path="/">
                <Home />
            </Route>

            
            <Route exact path="/sobre">
                <About />
            </Route>

        </Switch>
    )
}
